import React from 'react';
import { connect } from 'react-redux';

import CheckoutItemComponent from '../../components/checkout_item_component/CheckoutItemComponent';

import './checkout_page.styles.scss';

const CheckoutPage = props => {
  const { cartItems } = props;

  return (
    <div className="checkout-page">
      <div className="checkout-header">
        <div className="header-column">
          <span>Item</span>
        </div>
        <div className="header-column">
          <span>Detail</span>
        </div>
        <div className="header-column">
          <span>Price</span>
        </div>
        <div className="header-column">
          <span>Quantity</span>
        </div>
        <div className="header-column">
          <span>Remove</span>
        </div>
      </div>
      {cartItems.map(item => (
        <CheckoutItemComponent key={item.id} cartItem={item} />
      ))}
      <div className="checkout-total">Total: ${}</div>
    </div>
  );
};

const mapStateToProps = ({ cart: { cartItems } }) => {
  return {
    cartItems,
  };
};

export default connect(mapStateToProps)(CheckoutPage);
